import React,{Component} from 'react';
import Table from 'react-bootstrap/Table'
import './App.css';

class App extends Component {
  state = {
    properties: []
  }
  componentDidMount() {
    fetch('http://localhost:4000/properties')
    .then(res => res.json())
    .then((data) => {
      this.state.properties = data;
      console.log(this.state.properties);
    })
    .catch(console.log)
  }
  render() {
    return (
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Id</th>
            <th>Name</th>
            <th>Address</th>
            <th>City</th>
            <th>State</th>
            <th>Zip Code</th>
            <th>County</th>
            <th>Phone</th>
            <th>Type</th>
            <th>{this.state.properties[0]}</th>
          </tr>
        </thead>
         <tbody>
           {
                this.state.properties.map((numList,i) =>(
                   <tr key={i}>
                    {
                         <td>{numList.name}</td>
                    }
                   </tr>
                ))
           }
         </tbody>
      </Table>
    );
  }
}

export default App;
